import React, { useEffect, useState } from 'react'
import DashboardLayout from 'components/DashboardShared/DashboardLayout'
import useGetUserData from 'hooks/useGetUserSidebarData';
import DashboardContentWrapper from 'components/DashboardShared/DashboardContentWrapper';
import AppointmentDetailsButton from "components/AppointmentDetailsButton";
import axios from "axios";
import { useParams } from "react-router-dom";
import styled from 'styled-components'
import { fonts } from 'fonts';


const H2 = styled.h2`
    font-weight: ${fonts.medium};
    font-size: 30px;
    margin-bottom: 30px;
`

const UserAppointment = () => {

    const local = "http://localhost:5000/api";
    const [appointmentList, setAppointmentList] = useState([]);
    const [setHosId, setSetHosId] = useState();
    const id = useParams().id;
    console.log(id);
    useEffect(() => {
        axios.get(`${local}/userAppointment/${id}/myAppointments`).then((data) => {
            setAppointmentList(data.data);
            console.log(data.data)
            //   setSetHosId(data.withHospital);
        });
    }, [id]);
    const { userMenuData } = useGetUserData()
    return (
        <DashboardLayout menuData={userMenuData}>
            <DashboardContentWrapper>
                <div>
                    <H2>My Appointments</H2>
                    <table
                        className="text-md bg-white shadow-md rounded mb-4"
                        style={{ fontSize: "15px" }}
                    >
                        <tbody>
                            <tr className="border-b">
                                <th className="text-left py-3 px-1 border-2 ">S.N.</th>
                                <th className="text-left py-3 px-1 border-2 ">User Name</th>
                                <th className="text-left py-3 px-1 border-2 ">Contact.No</th>
                                <th className="text-left py-3 px-1 border-2 ">Service</th>
                                <th className="text-left py-3 px-1 border-2 ">Details</th>
                                <th className="text-left py-3 px-1 border-2 ">Doctor Assigned</th>
                                <th className="text-left py-3 px-1 border-2 ">Date</th>
                                <th className="text-left py-3 px-1 border-2 ">Time</th>
                                <th className="text-left py-3 px-1 border-2 ">Token No</th>
                            </tr>
                            {/* rows of data are below now */}
                            {appointmentList.map((res, index) => (
                                <tr
                                    className="border-b hover:bg-orange-100 bg-gray-100"
                                    style={{ fontSize: "13px" }}
                                >
                                    <td className="p-2 px-2 border-2">
                                        <span>{index + 1})</span>
                                    </td>
                                    <td className="p-2 px-2 border-2">
                                        <span>{res?.name}</span>
                                    </td>
                                    <td className="p-2 px-2 border-2">
                                        <span>9867134457</span>
                                    </td>
                                    <td className="p-2 px-2 border-2">
                                        <span>{res.services}</span>
                                    </td>
                                    <td className="p-2 px-2 border-2">
                                        <AppointmentDetailsButton res={res} />
                                    </td>
                                    <td className="p-2 px-2 border-2">
                                        <p>{res?.assignedDoctor}</p>
                                    </td>
                                    <td className="p-2 px-2 border-2">
                                        <p>{res?.appointDate}</p>
                                    </td>
                                    <td className="p-2 px-2 border-2">
                                        <p>{res?.docArrival}</p>
                                    </td>
                                    <td className="p-2 border-2">
                                        <p>{res?.token}</p>
                                    </td>
                                    <td className="p-3 px-5 flex justify-end">
                                        <button
                                            type="button"
                                            onClick={async () => {
                                                try {
                                                    await axios.put(
                                                        `${local}/userAppointment/${res?._id}/rejected`
                                                    );
                                                } catch (error) {
                                                    console.log(error);
                                                }
                                            }}
                                            className="text-sm bg-red-500 hover:bg-red-700 text-white py-1 px-2 rounded focus:outline-none focus:shadow-outline"
                                        >
                                            Reject
                                        </button>
                                    </td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            </DashboardContentWrapper>
        </DashboardLayout>
    )
}


    export default UserAppointment
